import { Link } from "react-router-dom";
import { BottleDetails } from "../bottledetails/BottleDetails";
import { BottleImg } from "../bottleimg/BottleImg";
import "./Product.css";
import "../bottledetails/BottleDetails.css";

export const Products = () => {
  return (
    <div className="prod"> 
      <BottleImg/>
      <div className="prod-details">
        <BottleDetails/>
        <div className="details">
          <p>In Stock</p>
          <Link to="#">Add to Cart</Link>
        </div>
      </div>
    </div>
  )
}
